import React, { Component } from 'react';
import './Menu.css';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
    NavbarText
} from 'reactstrap';
class Menu extends Component {

    render() {
        return (
            <div className="menu">
                <span>hihi</span>
                <span>hehe</span>
            </div>
        );
    }
}

export default Menu;
